INSERT INTO public.content_versions (id, "contentItemId", "approvedByUserId", "relatedEditId", "createdByUserId", "versionNumber", "contentSnapshot", description, "isCurrent", "createdAt") VALUES ('5d9278ce-2fb9-4e80-92e7-9d69657d60cd', '3779c4db-1a83-44c6-8cca-2d973c27a07f', '15c12682-b639-4c92-b320-c6cd1d6a5878', '817d7aa0-65c0-455f-a715-3d6ec3aff40c', '2f55e271-35c0-4178-a2ed-dd0f219ab4bc', 1, '{"media": {"imageUrls": ["https://res.cloudinary.com/dmoiixotu/image/upload/bo_3px_solid_rgb:4A90E2,r_8/v1768575311/content-edits/images/fajdu7bminwqefz68eee.jpg"]}, "title": "Tình Huống Ném Bóng Trong Trận Đấu", "format": null, "content": "[{\"insert\":\"# Tình Huống Ném Bóng Trong Trận Đấu## Tình HuốngTrong một trận đấu quan trọng, đội của bạn đang dẫn trước 2 điểm và chỉ còn 10 giây trên đồng hồ. Bạn có cơ hội ném phạt sau khi đối thủ phạm lỗi. Đây là thời điểm quyết định có thể ảnh hưởng đến kết quả trận đấu.## Vấn Đề Cần Giải QuyếtBạn cảm thấy áp lực rất lớn vì đây là cú ném có thể giúp đội bạn giành chiến thắng. Bạn cần giữ bình tĩnh và thực hiện cú ném chính xác.## Giải Pháp Từng Bước1. **Chuẩn Bị Tinh Thần**: Hít thở sâu và tập trung vào mục tiêu.2. **Tư Thế Đứng**: Đứng đúng tư thế, chân rộng bằng vai và gập nhẹ đầu gối.3. **Cầm Bóng**: Cầm bóng đúng cách, cảm nhận được sự thoải mái và chắc chắn.4. **Thực Hiện Cú Ném**: Nhấc bóng lên và thực hiện cú ném theo kỹ thuật đã học, giữ tập trung vào rổ.5. **Theo Dõi Kết Quả**: Nhìn theo bóng bay vào rổ, đảm bảo theo dõi cú ném cho đến khi bóng rời tay.## Kết Quả Và Phân Tích Kết QuảNếu cú ném thành công, bạn có thể giúp đội của mình giành chiến thắng. Nếu không, hãy xem xét lại từng bước đã thực hiện để tìm hiểu lý do.## Bài Học Rút RaTình huống này cho thấy tầm quan trọng của việc chuẩn bị tâm lý và nắm vững kỹ thuật ném bóng. Hãy luyện tập trong các tình huống thực tế để cải thiện khả năng xử lý áp lực.=======================sdasdasdsd=============\"}]", "rewards": {"xp": 15, "coin": 2}, "quizData": null, "difficulty": "medium", "richContent": [{"insert": "# Tình Huống Ném Bóng Trong Trận Đấu\n\n## Tình Huống\nTrong một trận đấu quan trọng, đội của bạn đang dẫn trước 2 điểm và chỉ còn 10 giây trên đồng hồ. Bạn có cơ hội ném phạt sau khi đối thủ phạm lỗi. Đây là thời điểm quyết định có thể ảnh hưởng đến kết quả trận đấu.\n\n## Vấn Đề Cần Giải Quyết\nBạn cảm thấy áp lực rất lớn vì đây là cú ném có thể giúp đội bạn giành chiến thắng. Bạn cần giữ bình tĩnh và thực hiện cú ném chính xác.\n\n## Giải Pháp Từng Bước\n1. **Chuẩn Bị Tinh Thần**: Hít thở sâu và tập trung vào mục tiêu.\n2. **Tư Thế Đứng**: Đứng đúng tư thế, chân rộng bằng vai và gập nhẹ đầu gối.\n3. **Cầm Bóng**: Cầm bóng đúng cách, cảm nhận được sự thoải mái và chắc chắn.\n4. **Thực Hiện Cú Ném**: Nhấc bóng lên và thực hiện cú ném theo kỹ thuật đã học, giữ tập trung vào rổ.\n5. **Theo Dõi Kết Quả**: Nhìn theo bóng bay vào rổ, đảm bảo theo dõi cú ném cho đến khi bóng rời tay.\n\n## Kết Quả Và Phân Tích Kết Quả\nNếu cú ném thành công, bạn có thể giúp đội của mình giành chiến thắng. Nếu không, hãy xem xét lại từng bước đã thực hiện để tìm hiểu lý do.\n\n## Bài Học Rút Ra\nTình huống này cho thấy tầm quan trọng của việc chuẩn bị tâm lý và nắm vững kỹ thuật ném bóng. Hãy luyện tập trong các tình huống thực tế để cải thiện khả năng xử lý áp lực.\n=======================\nsdasdasdsd\n=============\n"}]}', 'Version được tạo từ đóng góp: Tình Huống Ném Bóng Trong Trận Đấu', FALSE, '2026-01-16 21:56:18.368969');INSERT INTO public.content_versions (id, "contentItemId", "approvedByUserId", "relatedEditId", "createdByUserId", "versionNumber", "contentSnapshot", description, "isCurrent", "createdAt") VALUES ('8cc22bc0-4c4e-4eb3-9440-4b447f0dd47b', '3779c4db-1a83-44c6-8cca-2d973c27a07f', '15c12682-b639-4c92-b320-c6cd1d6a5878', '9a201aff-5823-4c31-ad3b-e07ca59a6591', '2f55e271-35c0-4178-a2ed-dd0f219ab4bc', 2, '{"media": {"caption": "tình huống ném trong trận đấu", "imageUrl": "/uploads/images/eb220df4-373b-4a57-8699-db054f936498.jpg", "videoUrl": "https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/BigBuckBunny.mp4", "imageUrls": ["https://res.cloudinary.com/dmoiixotu/image/upload/bo_3px_solid_rgb:4A90E2,r_8/v1768575311/content-edits/images/fajdu7bminwqefz68eee.jpg"], "description": "bài học chưa có hình ảnh", "imagePrompt": "A detailed educational illustration depicting a basketball player preparing to take a free throw in a crucial game situation. The player is standing with a focused expression, feet shoulder-width apart, knees slightly bent. The basketball is held correctly, with a clear view of the shooting form. The background shows a cheering crowd and a scoreboard displaying the remaining time. The image includes labels for key elements: ''Cầm Bóng'' (Holding the Ball), ''Tư Thế Đứng'' (Stance), ''Thực Hiện Cú Ném'' (Shooting Technique), and ''Theo Dõi Kết Quả'' (Follow Through). The style is professional and educational, suitable for basketball training materials.", "videoScript": "Chào mừng các bạn đến với bài học về tình huống ném bóng trong trận đấu bóng rổ! Hôm nay, chúng ta sẽ cùng nhau tìm hiểu về cú ném phạt trong một trận đấu quan trọng, khi chỉ còn 10 giây trên đồng hồ và đội của bạn đang dẫn trước 2 điểm.\n\nĐầu tiên, hãy chuẩn bị tinh thần. Hãy hít thở sâu và tập trung vào mục tiêu – rổ bóng.\n\nTiếp theo, tư thế đứng. Hãy đứng với chân rộng bằng vai và gập nhẹ đầu gối, tạo nền tảng vững chắc cho cú ném của bạn.\n\nBây giờ, cầm bóng đúng cách. Đảm bảo rằng bạn cảm thấy thoải mái và chắc chắn khi cầm bóng. Hãy nắm bóng với cả hai tay.\n\nKhi bạn thực hiện cú ném, hãy nhấc bóng lên và thả ra theo đúng kỹ thuật đã học, giữ tập trung vào rổ. Nhớ là theo dõi bóng bay vào rổ cho đến khi bóng rời tay bạn.\n\nCuối cùng, nếu cú ném thành công, đó sẽ là một chiến thắng cho đội bạn. Nếu không, hãy xem xét lại từng bước đã thực hiện để tìm hiểu lý do. Điều quan trọng là luyện tập để cải thiện khả năng xử lý áp lực trong các tình huống thực tế.\n\nHẹn gặp lại các bạn trong các bài học tiếp theo!", "videoDuration": "1-2 phút", "imageDescription": "Hình ảnh minh họa một cầu thủ bóng rổ đang chuẩn bị thực hiện cú ném phạt trong thời điểm quyết định của trận đấu. Các yếu tố kỹ thuật ném bóng được chú thích rõ ràng.", "videoDescription": "Video này hướng dẫn các kỹ thuật ném bóng trong tình huống căng thẳng của trận đấu bóng rổ, giúp bạn cải thiện khả năng xử lý áp lực và thực hiện cú ném thành công."}, "title": "Tình Huống Ném Bóng Trong Trận Đấu", "format": "mixed", "content": "[{\"insert\":\"# Tình Huống Ném Bóng Trong Trận Đấu## Tình HuốngTrong một trận đấu quan trọng, đội của bạn đang dẫn trước 2 điểm và chỉ còn 10 giây trên đồng hồ. Bạn có cơ hội ném phạt sau khi đối thủ phạm lỗi. Đây là thời điểm quyết định có thể ảnh hưởng đến kết quả trận đấu.## Vấn Đề Cần Giải QuyếtBạn cảm thấy áp lực rất lớn vì đây là cú ném có thể giúp đội bạn giành chiến thắng. Bạn cần giữ bình tĩnh và thực hiện cú ném chính xác.## Giải Pháp Từng Bước1. **Chuẩn Bị Tinh Thần**: Hít thở sâu và tập trung vào mục tiêu.2. **Tư Thế Đứng**: Đứng đúng tư thế, chân rộng bằng vai và gập nhẹ đầu gối.3. **Cầm Bóng**: Cầm bóng đúng cách, cảm nhận được sự thoải mái và chắc chắn.4. **Thực Hiện Cú Ném**: Nhấc bóng lên và thực hiện cú ném theo kỹ thuật đã học, giữ tập trung vào rổ.5. **Theo Dõi Kết Quả**: Nhìn theo bóng bay vào rổ, đảm bảo theo dõi cú ném cho đến khi bóng rời tay.## Kết Quả Và Phân Tích Kết QuảNếu cú ném thành công, bạn có thể giúp đội của mình giành chiến thắng. Nếu không, hãy xem xét lại từng bước đã thực hiện để tìm hiểu lý do.## Bài Học Rút RaTình huống này cho thấy tầm quan trọng của việc chuẩn bị tâm lý và nắm vững kỹ thuật ném bóng. Hãy luyện tập trong các tình huống thực tế để cải thiện khả năng xử lý áp lực.=======================sdasdasdsd=============\"}]", "rewards": {"xp": 15, "coin": 2}, "quizData": null, "difficulty": "medium", "richContent": [{"insert": "# Tình Huống Ném Bóng Trong Trận Đấu\n\n## Tình Huống\nTrong một trận đấu quan trọng, đội của bạn