INSERT INTO public.content_versions (id, "contentItemId", "approvedByUserId", "relatedEditId", "createdByUserId", "versionNumber", "contentSnapshot", description, "isCurrent", "createdAt") VALUES ('44ecb65d-b63a-4116-bf02-b06f2bd54f35', '3779c4db-1a83-44c6-8cca-2d973c27a07f', '15c12682-b639-4c92-b320-c6cd1d6a5878', '5772ed83-832a-4c72-b7ff-f46a9275e603', '2f55e271-35c0-4178-a2ed-dd0f219ab4bc', 3, '{"media": {"caption": "tình huống ném trong trận đấu", "imageUrl": "https://res.cloudinary.com/dmoiixotu/image/upload/bo_3px_solid_rgb:4A90E2,r_8/v1768901820/content-edits/migrated/osjsjgvoenweavy5ggfs.jpg", "videoUrl": "https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/BigBuckBunny.mp4", "imageUrls": ["https://res.cloudinary.com/dmoiixotu/image/upload/bo_3px_solid_rgb:4A90E2,r_8/v1768902022/content-edits/images/vazcw7p84t48skgvjirj.jpg"], "description": "bài học chưa có hình ảnh", "imagePrompt": "A detailed educational illustration depicting a basketball player preparing to take a free throw in a crucial game situation. The player is standing with a focused expression, feet shoulder-width apart, knees slightly bent. The basketball is held correctly, with a clear view of the shooting form. The background shows a cheering crowd and a scoreboard displaying the remaining time. The image includes labels for key elements: ''Cầm Bóng'' (Holding the Ball), ''Tư Thế Đứng'' (Stance), ''Thực Hiện Cú Ném'' (Shooting Technique), and ''Theo Dõi Kết Quả'' (Follow Through). The style is professional and educational, suitable for basketball training materials.", "videoScript": "Chào mừng các bạn đến với bài học về tình huống ném bóng trong trận đấu bóng rổ! Hôm nay, chúng ta sẽ cùng nhau tìm hiểu về cú ném phạt trong một trận đấu quan trọng, khi chỉ còn 10 giây trên đồng hồ và đội của bạn đang dẫn trước 2 điểm.\n\nĐầu tiên, hãy chuẩn bị tinh thần. Hãy hít thở sâu và tập trung vào mục tiêu – rổ bóng.\n\nTiếp theo, tư thế đứng. Hãy đứng với chân rộng bằng vai và gập nhẹ đầu gối, tạo nền tảng vững chắc cho cú ném của bạn.\n\nBây giờ, cầm bóng đúng cách. Đảm bảo rằng bạn cảm thấy thoải mái và chắc chắn khi cầm bóng. Hãy nắm bóng với cả hai tay.\n\nKhi bạn thực hiện cú ném, hãy nhấc bóng lên và thả ra theo đúng kỹ thuật đã học, giữ tập trung vào rổ. Nhớ là theo dõi bóng bay vào rổ cho đến khi bóng rời tay bạn.\n\nCuối cùng, nếu cú ném thành công, đó sẽ là một chiến thắng cho đội bạn. Nếu không, hãy xem xét lại từng bước đã thực hiện để tìm hiểu lý do. Điều quan trọng là luyện tập để cải thiện khả năng xử lý áp lực trong các tình huống thực tế.\n\nHẹn gặp lại các bạn trong các bài học tiếp theo!", "videoDuration": "1-2 phút", "imageDescription": "Hình ảnh minh họa một cầu thủ bóng rổ đang chuẩn bị thực hiện cú ném phạt trong thời điểm quyết định của trận đấu. Các yếu tố kỹ thuật ném bóng được chú thích rõ ràng.", "videoDescription": "Video này hướng dẫn các kỹ thuật ném bóng trong tình huống căng thẳng của trận đấu bóng rổ, giúp bạn cải thiện khả năng xử lý áp lực và thực hiện cú ném thành công."}, "title": "Tình Huống Ném Bóng Trong Trận Đấu", "format": "mixed", "content": "[{\"insert\":\"# Tình Huống Ném Bóng Trong Trận Đấu## Tình HuốngTrong một trận đấu quan trọng, đội của bạn đang dẫn trước 2 điểm và chỉ còn 10 giây trên đồng hồ. Bạn có cơ hội ném phạt sau khi đối thủ phạm lỗi. Đây là thời điểm quyết định có thể ảnh hưởng đến kết quả trận đấu.## Vấn Đề Cần Giải QuyếtBạn cảm thấy áp lực rất lớn vì đây là cú ném có thể giúp đội bạn giành chiến thắng. Bạn cần giữ bình tĩnh và thực hiện cú ném chính xác.## Giải Pháp Từng Bước1. **Chuẩn Bị Tinh Thần**: Hít thở sâu và tập trung vào mục tiêu.2. **Tư Thế Đứng**: Đứng đúng tư thế, chân rộng bằng vai và gập nhẹ đầu gối.3. **Cầm Bóng**: Cầm bóng đúng cách, cảm nhận được sự thoải mái và chắc chắn.4. **Thực Hiện Cú Ném**: Nhấc bóng lên và thực hiện cú ném theo kỹ thuật đã học, giữ tập trung vào rổ.5. **Theo Dõi Kết Quả**: Nhìn theo bóng bay vào rổ, đảm bảo theo dõi cú ném cho đến khi bóng rời tay.## Kết Quả Và Phân Tích Kết QuảNếu cú ném thành công, bạn có thể giúp đội của mình giành chiến thắng. Nếu không, hãy xem xét lại từng bước đã thực hiện để tìm hiểu lý do.## Bài Học Rút RaTình huống này cho thấy tầm quan trọng của việc chuẩn bị tâm lý và nắm vững kỹ thuật ném bóng. Hãy luyện tập trong các tình huống thực tế để cải thiện khả năng xử lý áp lực.=======================sdasdasdsd=============\"}]", "rewards": {"xp": 15, "coin": 2}, "quizData": null, "difficulty": "medium", "richContent": [{"insert": "# Tình Huống Ném Bóng Trong Trận Đấu\n\n## Tình Huống\nTrong một trận đấu quan trọng, đội của bạn đang dẫn trước 2 điểm và chỉ còn 10 giây trên đồng hồ. Bạn có cơ hội ném phạt sau khi đối thủ phạm lỗi. Đây là thời điểm quyết định có thể ảnh hưởng đến kết quả trận đấu.\n\n## Vấn Đề Cần Giải Quyết\nBạn cảm thấy áp lực rất lớn vì đây là cú ném có thể giúp đội bạn giành chiến thắng. Bạn cần giữ bình tĩnh và thực hiện cú ném chính xác.\n\n## Giải Pháp Từng Bước\n1. **Chuẩn Bị Tinh Thần**: Hít thở sâu và tập trung vào mục tiêu.\n2. **Tư Thế Đứng**: Đứng đúng tư thế, chân rộng bằng vai và gập nhẹ đầu gối.\n3. **Cầm Bóng**: Cầm bóng đúng cách, cảm nhận được sự thoải mái và chắc chắn.\n4. **Thực Hiện Cú Ném**: Nhấc bóng lên và thực hiện cú ném theo kỹ thuật đã học, giữ tập trung vào rổ.\n5. **Theo Dõi Kết Quả**: Nhìn theo bóng bay vào rổ, đảm bảo theo dõi cú ném cho đến khi bóng rời tay.\n\n## Kết Quả Và Phân Tích Kết Quả\nNếu cú ném thành công, bạn có thể giúp đội của mình giành chiến thắng. Nếu không, hãy xem xét lại từng bước đã thực hiện để tìm hiểu lý do.\n\n## Bài Học Rút Ra\nTình huống này cho thấy tầm quan trọng của việc chuẩn bị tâm lý và nắm vững kỹ thuật ném bóng. Hãy luyện tập trong các tình huống thực tế để cải thiện khả năng xử lý áp lực.\n=======================\nsdasdasdsd\n=============\n"}]}', 'Version được tạo từ đóng góp: Tình Huống Ném Bóng Trong Trận Đấu', TRUE, '2026-01-20 16:41:25.098981');INSERT INTO public.content_versions (id, "contentItemId", "approvedByUserId", "relatedEditId", "createdByUserId", "versionNumber", "contentSnapshot", description, "isCurrent", "createdAt") VALUES ('c329d71a-3c77-457b-9cf9-554fb3f7c904', '4bcb48a9-f862-4043-a7a9-e598a73587ff', '15c12682-b639-4c92-b320-c6cd1d6a5878', '597d4576-b81f-4521-9e63-a719d1cafd46', '2f55e271-35c0-4178-a2ed-dd0f219ab4bc', 1, '{"media": {"caption": "jgh", "imageUrl": "https://res.cloudinary.com/dmoiixotu/image/upload/bo_3px_solid_rgb:4A90E2,r_8/v1769328980/content-edits/images/xog1v1v3iy5z7gzbcetp.jpg", "videoUrl": "https://commondatastorage.googleapis.com/gtv-videos-bucket/sample/BigBuckBunny.mp4", "description": "gjh", "imagePrompt": "A simple and colorful illustration showing a young person playing basketball on an outdoor court. The character is dribbling a basketball with their right hand, showcasing a playful and energetic pose. There are bright colors and minimal details to make it easy to understand, with a cheerful and educational style appropriate for beginners learning basketball techniques.", "videoScript": "Chào các bạn! Hôm nay, chúng ta sẽ học về kỹ thuật dribble bóng trong bóng rổ! Hãy tưởng tượng bạn đang ở sân bóng cùng bạn bè. Bạn nhận bóng và muốn đưa nó đến khu vực rổ. Đầu tiên, hãy dùng tay phải của bạn để dribble. Nhẹ nhàng chạm vào bóng và đẩy nó về phía trước.\n\nNhìn xem, bóng bắt đầu nhảy lên và xuống! Điều này nghĩa là bạn đã làm quen với kỹ thuật này rồi đấy! Giờ bạn có thể di chuyển sang trái, sang phải mà không để bóng rơi ra ngoài tầm kiểm soát.\n\nNếu đột nhiên có một người bạn đến để cướp bóng, bạn hãy thực hiện động tác crossover! Chuyển bóng sang tay bên kia và tiếp tục di chuyển. Hãy tưởng tượng như bạn đang lái xe máy qua một chướng ngại vật. Bạn cần nhanh nhẹn và linh hoạt. Thật là thú vị phải không nào?", "videoDuration": "30-60 giây", "imageDescription": "Hình ảnh minh họa một người trẻ đang chơi bóng rổ và thực hiện kỹ thuật dribble. Đây là một cách giới thiệu đơn giản về khái niệm chơi bóng rổ cho người mới bắt đầu.", "videoDescription": "Video này giúp bạn làm quen với kỹ thuật dribble cơ bản trong bóng rổ một cách đơn giản và vui nhộn."}, "title": "Dribble Ngắn Giới Thiệu", "format": "mixed", "content": "Hãy tưởng tượng bạn đang chơi bóng rổ trong sân ở khu phố cùng bạn bè. Bạn nhận bóng và muốn đưa nó đến khu vực rổ. Đầu tiên, bạn dùng tay phải để dribble bóng. Bằng cách chạm nhẹ vào bóng, bạn đẩy nó về phía trước. Dần dần, bạn sẽ thấy bóng bắt đầu nhảy lên và xuống, điều này nghĩa là bạn đã bắt đầu làm quen với kỹ thuật này. Bạn có thể di chuyển sang trái, sang phải mà không để bóng rơi ra ngoài tầm kiểm soát. Nếu đột nhiên có một người bạn chạy đến để cướp bóng, bạn có thể dễ dàng thực hiện động tác crossover để đưa bóng sang tay bên kia và tiếp tục di chuyển. Điều này giống như khi bạn đang lái xe máy và phải lái qua một chướng ngại vật, bạn cần phải nhanh nhẹn và linh hoạt!", "rewards": {"xp": 12, "coin": 1}, "quizData": null, "difficulty": "easy", "richContent": null}', 'Version được tạo từ đóng góp: add_image', TRUE, '2026-01-25 15:17:26.684074');
